import React from "react";
import "./App.css";
import "./icons";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import AuthPage from "./Components/AuthPage";
import Navbar from "./Components/Navbar";

import Sidebar from "./Components/Sidebar";
import Home from "./Components/Home";
import Groups from "./Components/Groups";
import Events from "./Components/Events";
import Marketplace from "./Components/Marketplace";
import Friends from "./Components/Friends";
import Explore from "./Components/Explore";
import Messages from "./Components/Messages";
import Notifications from "./Components/Notifications";
import Settings from "./Components/Settings";
import HelpCenter from "./Components/HelpCenter";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route exact path="/" element={<AuthPage />} />

        {/* Navbar Routes */}
        <Route
          exact
          path="/home"
          element={
            <>
              <Navbar />
              <Sidebar />
              <Home />
            </>
          }
        ></Route>
        <Route
          exact
          path="/explore"
          element={
            <>
              <Navbar />
              <Sidebar />
              <Explore />
            </>
          }
        ></Route>
        <Route
          exact
          path="/messages"
          element={
            <>
              <Navbar />
              <Sidebar />
              <Messages />
            </>
          }
        ></Route>
        <Route
          exact
          path="/notifications"
          element={
            <>
              <Navbar />
              <Sidebar />
              <Notifications />
            </>
          }
        ></Route>
        <Route
          exact
          path="/settings"
          element={
            <>
              <Navbar />
              <Sidebar />
              <Settings />
            </>
          }
        ></Route>
        <Route
          exact
          path="/helpCenter"
          element={
            <>
              <Navbar />
              <Sidebar />
              <HelpCenter />
            </>
          }
        ></Route>
        <Route
          exact
          path="/logout"
          element={
            <>
              <Navbar />
              <Sidebar />
              <Home />
            </>
          }
        ></Route>

        {/* Sidebar Routes */}
        <Route
          exact
          path="/groups"
          element={
            <>
              <Navbar />
              <Sidebar />
              <Groups />
            </>
          }
        ></Route>
        <Route
          exact
          path="/events"
          element={
            <>
              <Navbar />
              <Sidebar />
              <Events />
            </>
          }
        ></Route>
        <Route
          exact
          path="/marketplace"
          element={
            <>
              <Navbar />
              <Sidebar />
              <Marketplace />
            </>
          }
        ></Route>
        <Route
          exact
          path="/friends"
          element={
            <>
              <Navbar />
              <Sidebar />
              <Friends />
            </>
          }
        ></Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
